function generate_sector_bubbles(sector_indexes) {
    var market_list = [];
    var market_details_list = [];
    var sector_bubbles = "";
    let market_sizes = [{MarketName: "", MarketSize: "", Rank: 0},
                        {MarketName : "Consumer", MarketSize: "$11T", Rank: 1},
                        {MarketName : "Enterprise", MarketSize: "$237B", Rank: 3},
                        {MarketName : "Deep Tech", MarketSize: "$80B", Rank: 6},
                        {MarketName : "FinTech", MarketSize: "$150B", Rank: 4},
                        {MarketName : "Impact", MarketSize: "$574B", Rank: 2},
                        {MarketName : "Life Sciences", MarketSize: "$102B", Rank: 5},
                        {MarketName : "Web3", MarketSize: "$7B", Rank: 7},
                        {MarketName : "", MarketSize: "", Rank: 8}];

    for (i = 0 ; i < sector_indexes.length ; i++) {
        market_list.push(getDictionaryEntry(market_sizes, sector_indexes[i]).Rank);
    }

    market_list.sort(function(a, b) {
        return a - b;
    });

    for (i = 0 ; i < market_list.length; i++) {
        if (i >=3) {
            break;
        }
        market_details_list.push(market_sizes.filter(obj => obj.Rank === market_list[i])[0]);
    }

    switch (market_details_list.length) {
        case 0: sector_bubbles = "";
            break
        case 1: sector_bubbles = `<svg width="304" height="163" viewBox="0 0 304 163" fill="none" xmlns="http://www.w3.org/2000/svg">
                                    <circle cx="138.858" cy="79.4549" r="79.4549" fill="#182C50" />
                                    <text x="138" y="35" text-anchor="middle" font-family="DM Sans" font-size="16" fill="white">${market_details_list[0].MarketName}</text>
                                    <text x="138" y="60" text-anchor="middle" font-family="DM Sans" font-size="24" fill="white">${market_details_list[0].MarketSize}</text>
                                </svg>`;
            break
        case 2: sector_bubbles = `<svg width="304" height="163" viewBox="0 0 304 163" fill="none" xmlns="http://www.w3.org/2000/svg">
                                    <circle cx="138.858" cy="79.4549" r="79.4549" fill="#182C50" />
                                    <text x="138" y="35" text-anchor="middle" font-family="DM Sans" font-size="16" fill="white">${market_details_list[0].MarketName}</text>
                                    <text x="138" y="60" text-anchor="middle" font-family="DM Sans" font-size="24" fill="white">${market_details_list[0].MarketSize}</text>
                                    <circle cx="242.891" cy="101.846" r="60.8907" fill="#6292E9" />
                                    <text x="242" y="75" text-anchor="middle" font-family="DM Sans" font-size="14" fill="black">${market_details_list[1].MarketName}</text>
                                    <text x="242" y="105" text-anchor="middle" font-family="DM Sans" font-size="24" fill="black">${market_details_list[1].MarketSize}</text>
                                </svg>`;
            break
        case 3: sector_bubbles = `<svg width="304" height="163" viewBox="0 0 304 163" fill="none" xmlns="http://www.w3.org/2000/svg">
                                    <circle cx="138.858" cy="79.4549" r="79.4549" fill="#182C50" />
                                    <text x="138" y="35" text-anchor="middle" font-family="DM Sans" font-size="16" fill="white">${market_details_list[0].MarketName}</text>
                                    <text x="138" y="60" text-anchor="middle" font-family="DM Sans" font-size="24" fill="white">${market_details_list[0].MarketSize}</text>
                                    <circle cx="242.891" cy="101.846" r="60.8907" fill="#6292E9" />
                                    <text x="242" y="75" text-anchor="middle" font-family="DM Sans" font-size="14" fill="black">${market_details_list[1].MarketName}</text>
                                    <text x="242" y="105" text-anchor="middle" font-family="DM Sans" font-size="24" fill="black">${market_details_list[1].MarketSize}</text>
                                    <ellipse cx="50.4947" cy="111.788" rx="50.4947" ry="50.8331" fill="#5ACED6" />
                                    <text x="51" y="85" text-anchor="middle" font-family="DM Sans" font-size="12" fill="black">${market_details_list[2].MarketName}</text>
                                    <text x="51" y="115" text-anchor="middle" font-family="DM Sans" font-size="24" fill="black">${market_details_list[2].MarketSize}</text>
                                </svg>`;
            break
        default: 
            sector_bubbles ="";
    }

    if (market_details_list <= 3) {
        document.getElementById('fund-return-text-content').textContent = 'Your portfolio includes the fastest-growing sectors with huge market potential. These frontier tech startups will be technical with core IP; some may be betting on scientific breakthroughs to produce category-defining results.'
    } else if (market_details_list <= 5) {
        document.getElementById('fund-return-text-content').textContent = 'Your portfolio includes exposure to promising industry sectors with well-quantified market sizes. Most startups operating in this dynamic utilize technology to drive better unit economics and go-to-market tactics to win market share. Fund returns will be driven by building exposure to many category winners who can scale quickly.'
    } else if (market_details_list <= 8) {
        document.getElementById('fund-return-text-content').textContent = 'Your portfolio includes exposure to large but mature industry sectors where startup companies are attacking the competitive moats of the incumbents. Business model innovation versus technological innovation will be the main driver of fund returns.'
    }
    
    document.getElementById('return-assessment-graphic').innerHTML = sector_bubbles;
}

